DROP TABLE IF EXISTS "patient_info" CASCADE;
CREATE TABLE IF NOT EXISTS "patient_info" ("id" INTEGER , "first_name" VARCHAR(255), "age" INTEGER, "last_name" VARCHAR(255), "gender" VARCHAR(255), PRIMARY KEY ("id"));
DROP TABLE IF EXISTS "treatments" CASCADE;
CREATE TABLE IF NOT EXISTS "treatments" ("patient_id" INTEGER REFERENCES "patient_info" ("id"), "id" INTEGER , "date" VARCHAR(255), "description" VARCHAR(150), PRIMARY KEY ("id"));
